function addGame(dateIndex){

	for (var di=0;di<dateIndex;di++){
		if (dateList[di][1]<1) {
			var schedule = fullSchedule[dateList[di][0]];
	
			for (var i=0;i<schedule.length;i++){
				var stream1 = new Random();
				runs1 = stream1.weibull(teamData[schedule[i]['vteam']]['runs']*teamData[schedule[i]['hteam']]['allowed']/lgavg,1.8);
				runs2 = stream1.weibull(teamData[schedule[i]['hteam']]['runs']*teamData[schedule[i]['vteam']]['allowed']/lgavg,1.8);
				var betType = [false,false];
				if (schedule[i]['bet'] ) {
					if (schedule[i]['bet'][0]<0) {betType[0] = true;}
					else if (schedule[i]['bet'][0]>0) {betType[1] = true;}
				}
				if (runs1>runs2){
					teamData[schedule[i]['vteam']]['wins']+=1;
					teamData[schedule[i]['hteam']]['losses']+=1;
					teamData[schedule[i]['vteam']]['actualScored']+=runs1;
					teamData[schedule[i]['vteam']]['actualAllowed']+=runs2;
					teamData[schedule[i]['hteam']]['actualScored']+=runs2;
					teamData[schedule[i]['hteam']]['actualAllowed']+=runs1;
					if (betType[0]) { 
						bankroll += schedule[i]['bet'][0];
						bankroll -= schedule[i]['bet'][0]/(1-schedule[i]['bet'][1]);
					}
					else if (betType[1]) { 
						bankroll -= schedule[i]['bet'][0];
					}
					
				}
				else if (runs2>runs1){
					teamData[schedule[i]['hteam']]['wins']+=1;
					teamData[schedule[i]['vteam']]['losses']+=1;
					teamData[schedule[i]['vteam']]['actualScored']+=runs1;
					teamData[schedule[i]['vteam']]['actualAllowed']+=runs2;
					teamData[schedule[i]['hteam']]['actualScored']+=runs2;
					teamData[schedule[i]['hteam']]['actualAllowed']+=runs1;
					if (betType[0]) { 
						bankroll += schedule[i]['bet'][0];
						
					}
					else if (betType[1]) { 
						bankroll -= schedule[i]['bet'][0];
						bankroll += schedule[i]['bet'][0]/(schedule[i]['bet'][1]);
					}
				}
				document.getElementById(schedule[i]['vteam']+'wins').textContent=teamData[schedule[i]['vteam']]['wins'];
				document.getElementById(schedule[i]['vteam']+'losses').textContent=teamData[schedule[i]['vteam']]['losses'];
				document.getElementById(schedule[i]['hteam']+'wins').textContent=teamData[schedule[i]['hteam']]['wins'];
				document.getElementById(schedule[i]['hteam']+'losses').textContent=teamData[schedule[i]['hteam']]['losses'];
				
				document.getElementById(schedule[i]['vteam']+'runsScored').textContent=Math.round(teamData[schedule[i]['vteam']]['actualScored']);
				document.getElementById(schedule[i]['vteam']+'runsAllowed').textContent=Math.round(teamData[schedule[i]['vteam']]['actualAllowed']);
				document.getElementById(schedule[i]['hteam']+'runsScored').textContent=Math.round(teamData[schedule[i]['hteam']]['actualScored']);
				document.getElementById(schedule[i]['hteam']+'runsAllowed').textContent=Math.round(teamData[schedule[i]['hteam']]['actualAllowed']);
			}
			
			dateList[di][1]=1;
		}
	}
	updateStandings();

	if (dateList[dateIndex][1]<1) {
		var schedule = fullSchedule[dateList[dateIndex][0]];
		updateSchedule(schedule);
	}

	
	
}

function updateStandings() {
	var len = Object.keys(teams).length;
	for (var i=0;i<len;i++){
		var league = Object.keys(teams)[i];
		var elementLeague = document.getElementById('league'+league);
		
		var numDivisions = Object.keys(teams[league]).length;
		for (var ii=0;ii<numDivisions;ii++) {
			var division = Object.keys(teams[league])[ii];
			var divTable = document.getElementById(league+division+'Table');
			
			var divLen = Object.keys(teams[league][division]).length;
			var notSorted = true;
			while (notSorted){
				notSorted = false;
				for (var iii=0;iii<divLen-1;iii++){
					if (teamData[teams[league][division][iii]]['wins']-teamData[teams[league][division][iii]]['losses']<teamData[teams[league][division][iii+1]]['wins']-teamData[teams[league][division][iii+1]]['losses']){
						var hold = teams[league][division][iii+1];
						teams[league][division][iii+1]=teams[league][division][iii];
						teams[league][division][iii]=hold;
						divTable.insertBefore(document.getElementById(teams[league][division][iii]+'row'),document.getElementById(teams[league][division][iii+1]+'row'));
						notSorted = true;
					}
				}
			}
		}
	}
	document.getElementById("currentBankroll").innerHTML = bankroll;
}

function updateSchedule(todaySched) {
	var scheduleBody = document.getElementById('scheduleBody');
	scheduleBody.innerHTML = '';
	var schedLen = todaySched.length;
	for (var i=0;i<schedLen;i++){
		var scheduleRow = document.createElement("tr");
		var td1 = document.createElement("td");
		td1.textContent = todaySched[i]['vteam'];
		scheduleRow.appendChild(td1);
		var td2 = document.createElement("td");
		td2.textContent = todaySched[i]['hteam'];
		scheduleRow.appendChild(td2);
		var td3 = document.createElement("td");
		var vegas = vegasFunction(teamData[todaySched[i]['vteam']]['wins'],teamData[todaySched[i]['vteam']]['losses'],teamData[todaySched[i]['hteam']]['wins'],teamData[todaySched[i]['hteam']]['losses']);
		td3.textContent = vegas;
		scheduleRow.appendChild(td3);
		var td4 = document.createElement("td");
		var pred = bettingFunction(teamData[todaySched[i]['vteam']]['actualScored'],teamData[todaySched[i]['vteam']]['actualAllowed'],teamData[todaySched[i]['hteam']]['actualScored'],teamData[todaySched[i]['hteam']]['actualAllowed']);
		td4.textContent = pred;
		scheduleRow.appendChild(td4);
		scheduleBody.appendChild(scheduleRow);
		var td5 = document.createElement("td");
		
		var mybet = bankrollFunction(vegas,pred,bankroll);
		todaySched[i]['bet']=[mybet,vegas];
		td5.textContent = mybet;
		scheduleRow.appendChild(td5);
		scheduleBody.appendChild(scheduleRow);
			
	}
}

var vegasFunction;
var bettingFunction;
var bankrollFunction;
function chooseTeam(teamName){
	
	if (chosenTeam != ''){
		myValue += teamData[chosenTeam]['wins'];
		var teamRow = document.getElementById(chosenTeam+'row');
		teamRow.style.backgroundColor = '';
	}

	chosenTeam = teamName;
	myValue -= teamData[chosenTeam]['wins'];
	var teamRow = document.getElementById(teamName+'row');
	teamRow.style.backgroundColor = 'red';
	console.log(myValue);
}


