  function setFormulas(formulaUrl1,formulaUrl2,formulaUrl3) {
	caja.load(undefined, undefined, function(frame) {
		frame.code(formulaUrl1, 'application/javascript')
			 .run(function (guestF) {
				 vegasFunction = frame.untame(guestF);
			 });
	    frame.code(formulaUrl2, 'application/javascript')
			 .run(function (guestF) {
				 bettingFunction = frame.untame(guestF);
			 });
		frame.code(formulaUrl3, 'application/javascript')
			 .run(function (guestF) {
				 bankrollFunction = frame.untame(guestF);
			 });
	});
  }

